from collections import defaultdict
files = defaultdict(list)

curr_sample = None
curr_reco = None
curr_sim = None
for line in lines:
    line = line.strip()
    if ':' in line:
        if curr_sample is not None:
            files[curr_sample].append((curr_reco, tuple(curr_sim)))
        curr_sample, curr_reco = line.split(':')
        curr_sim = []
    elif curr_sample is not None:
        curr_sim.append(line)

for k in files.keys():
    files[k].sort(key=lambda x: int(x[0].split('_')[-3])) # sort by reco file order
    files[k] = tuple(files[k])

def load(process, sample, file_range, sec_files=True):
    if file_range == 'all':
        file_range = xrange(len(files[sample]))
    if not hasattr(file_range, '__iter__'):
        file_range = [file_range]
    reco_files = []
    sim_files = []
    for x in file_range:
        rf, sf = files[sample][x]
        reco_files.append(rf)
        sim_files.extend(sf)
    process.source.fileNames = cms.untracked.vstring(*reco_files)
    if sec_files:
        process.source.secondaryFileNames = cms.untracked.vstring(*sim_files)
